import React, {Component} from 'react';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

import Footer from './elements/Footer.js';
import Header from './elements/Header.js';
import AllNews from './news/AllNews.js';
import TopHeadlines from './news/TopHeadlines.js';

import './App.css';

class App extends Component {
  render() {
    return (
      <Router>
        <div>
          
          <div id="main">
            <div className="site-section site-portfolio">
              <div className="container">
                <Header />

                <Switch>
                  <Route path="{process.env.PUBLIC_URL + '/'}" exact={true} component={TopHeadlines} ></Route>
                  <Route path="{process.env.PUBLIC_URL + '/:handle'}" component={AllNews} ></Route>
                </Switch>
              </div>
            </div>
          </div>

          <Footer />
        </div>
      </Router>
    );
  }

}

export default App;
